import './Left.css'

const Left = () => {
    return(
        <div className="left-body">
            <h1>Rent, Host, <br/> Explore.</h1>
            <h6 >HrFs provide you with the <br/> best service for house <br/> renting and hosting </h6>
            <div>
            <div className="Button"><p className="btn1">Become a Host</p></div>
            <div className="Button"><p className="btn2">Rent a House</p></div>
            </div>
        </div>
    )
}
export default Left;
